import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import api from './service/api';


class Main extends React.Component{
    constructor(props){
      super(props);
      this.state = {};
    }

    componentDidMount(){
      this.loadData();
    }

    loadData = async () => {
      try{
        let result = await api.get('/api/v2/pages/?type=posts.PostPage&fields=post_image');
        this.setState({
          list: result.data
        });
      }catch(e){
        console.log(e)
      }
    }

    render(){
      console.log(this.state);
      return(
        <div>
          <h1>OIIIIIIIIIAFD</h1>
          <ul>
            {this.state.list && 
            this.state.list.items.map(item => (
              <li>
                <p>{item.title}</p>
                <img 
                  src = {`http://localhost:8000${item.post_image.url}`}
                />
              </li>
            ))
            }
          </ul>
        </div>
      )
    }
}

ReactDOM.render(
  <Main />,
  document.getElementById('root')
);
